import React from 'react';
import './index.css';
type ListingProps = {
  listingTitle: string,
  isStriked:boolean
}

function ListingComponent() {
  let x: ListingProps = {
    listingTitle: 'abc',
    isStriked:false
}
const newlistingProps = [x,x,x,x,x,x,x]

  return (newlistingProps.map((element)=>{
   (
    <div className="headerContainer">
      <p className="headerTitleStyle">{element.listingTitle}</p>
    </div>)
    })
  );
}

export default ListingComponent;
